const User = () => {
const [data, setData] = useState(0)
const increaseData =()=>{
    setData(data+1)
}
const decreaseData = ()=>{
    setData(data-1)
}

    return (
        <div>
            <h1>{data}</h1>
            <button onClick={increaseData}> Increase </button>
            <button onClick={decreaseData}> Decrease </button>
        </div>
    )
}

export default User
